import React from 'react';
import { Header } from 'semantic-ui-react'

export default class About extends React.Component{
    render(){
        return(
            <div>
                <Header blueas='h1'>Mario Rodriguez</Header>
                <Header as='h1'>Software Engineer | React.js, Ruby on Rails, Javascript</Header>
            </div>
        )
    }
}
